import { Button, Navbar } from "react-bootstrap";
import ProductCard from "./ProductCard";
import { useState } from "react";



function Menu() {
 
    return (
        <>
            <div>

                <h3 style={{ marginTop: "20px" }} className="text-center">Our Menu</h3>
                <hr className="custom-hr" />

            </div>
            <div className="text-center">
                <button className="btn btn-light mx-2" >All</button>
                <button className="btn btn-light mx-2">Breakfast</button>
                <button className="btn btn-light mx-2">Lunch</button>
                <button className="btn btn-light mx-2">Shake</button>
                <button className="btn btn-light mx-2">Dinner</button>
            </div>
          
            <div style={{marginTop:"30px"}}>
                <ProductCard/>
            </div>



            



        </>
    )
}
export default Menu;
